      this.setState({currentPage: currentPages})
    }
    

   render () {
      const currentPages = () => {
         if (this.state.currentPage === "playlist") 
            return <Playlists/>
         else if (this.state.currentPage === "playlistdetail") 
            return <PlaylistDetail/>
         
      }

      return ( 
         <ManagerPlaylist >
          {currentPages()}
          <PlaylistDetail changin/>
          </ManagerPlaylist>
         )
   }
  
}

